import { useEffect, useState } from "react";
import Header from "./Header";
import {USER_API_URL,FLAT_API_URL} from './AppConst';
import {fetchPost,fetchGet,getUserId,fetchDelete,fetchFileUpload} from './AppService';
function FlatCreation(){

  const [pincode,setPincode] = useState('');
  const [address,setAddress] = useState('');
  let imgName = "";
  const [rent,setRent] = useState('');
  const [sqft,setSqft] = useState('');
  const [bhk,setBhk] = useState('');
  const [editId,setEditId] = useState(0);

  const [selectedFile,setSelectedFile] = useState();

  const [flatList,setFlatList] = useState([]);
  const editFlat = (flat)=>{
    setEditId(flat.id);
    setRent(flat.rent);
    setAddress(flat.address);
    setSqft(flat.sqft);
    setBhk(flat.bhk);
    setPincode(flat.pincode);
  }
  const cancelEdit=()=>{
    setEditId(0);
    setRent("");
    setAddress("");
    setSqft("");
    setBhk("");
    setPincode("");
  }
const deleteFlat=(flat)=>{

    if(!window.confirm("Are you wanna delete this flat.?")){
      return;
    }

    fetchDelete(FLAT_API_URL+"flat/delete/"+flat.id)
    .then(res=>{
      alert("flat deleted.");
      getAll();//refresh flat
      //setFlatList(res);
    }).catch(err=>{
      err.then(er=>{
        alert(er['message']);
        //console.log(er);
      })
    }) 

}
  const getAll=()=>{

    //rent bhk pincode
    let param = {
      'searchType':''
    }
    fetchPost(FLAT_API_URL+"flat/search",param)
    .then(res=>{
      let user_id = getUserId();
      let filterFlat = res.filter(o=>o.owner_id == user_id)
      //console.log(res)
      setFlatList(filterFlat);
    });
  }
 const onFileChange = (event) => {

    // Update the state
    setSelectedFile(event.target.files[0] );

  };
  const editUpdate=()=>{
    createFlat();
  }
  const imgUpload=()=>{
    let file = new FormData();
    if(selectedFile == undefined || selectedFile ==""){
      alert("Please select Image");
      return;
    } if(address == ""){
      alert("Address should not be empty");
      return;
    }else if(pincode == ""){
      alert("Pincode should not be empty");
      return;
    }else if(rent == ""){
      alert("Rent should not be empty");
      return;
    }else if(sqft == ""){
      alert("Sqft should not be empty");
      return;
    }else if(bhk == ""){
      alert("Bhk should not be empty");
      return;
    }else{
      file.append("file",selectedFile);
      file.append('fileName', selectedFile.name);

      fetchFileUpload(FLAT_API_URL+"flat/imgUpload",file)
      .then(res=>{
        imgName = res['message'];
        createFlat();
      }).catch(err=>{
        alert("Error: "+err.message);
      });
    }

  }

  const createFlat=()=>{
    if(address == ""){
      alert("Address should not be empty");
      return;
    }else if(pincode == ""){
      alert("Pincode should not be empty");
      return;
    }else if(rent == ""){
      alert("Rent should not be empty");
      return;
    }else if(sqft == ""){
      alert("Sqft should not be empty");
      return;
    }else if(bhk == ""){
      alert("Bhk should not be empty");
      return;
    }else{
      let param = {
        'address':address,
        'pincode':pincode,
        "rent":rent,
        "sqft":sqft,
        "bhk":bhk,
        "owernerId":getUserId()
      }
      let urlMethod = "create";
      if(editId > 0){
        param.id = editId;
        urlMethod = "edit";
      }
      if(imgName != ""){
        param.imgName = imgName;
      }

      fetchPost(FLAT_API_URL+"flat/"+urlMethod,param)
      .then(res=>{
        console.log(res);
        alert("FLat is "+urlMethod+"ed");
        getAll();
        cancelEdit();//clear the fields
        //setFlatList(res);
      }).catch(err=>{
        alert("Error: "+err.message);
      });
    }

  }
  useEffect(()=>{
    getAll()
},[])


